import React from "react";
import movies from "../movies"

function App(){
    {movies.map((data) =>{
        return(
           <dl>
  <dt>{data.title}</dt>
  <dd>{data.cotent}</dd>
  <dt>Milk</dt>
  <dd>White cold drink</dd>
</dl> 
        );
    });
}
}

export default App
